import React from "react";
import Map from '../components/Map';

const Home = () => {
    return (
        <div>
            <div className="home">
                <h1>Come Boulder at the Middlebury Gap</h1>
                <p>Developing the Boulders at Middlebury Gap</p>
            </div>
            <div className="map">
                <Map />
            </div>
        </div>
    );
}

export default Home;
